class Solution {
    public int minimumChanges(String s, int k) {
        int n = s.length();
        int[][] dp = new int[k + 1][n + 1];
        for (int i = 0; i <= k; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = Integer.MAX_VALUE / 2;
            }
        }
        dp[0][0] = 0;

        for (int i = 1; i <= k; i++) {
            for (int j = 1; j <= n; j++) {
                for (int l = 1; l <= j; l++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - l] + minChanges(s.substring(j - l, j)));
                }
            }
        }

        return dp[k][n];
    }

    private int minChanges(String s) {
        int n = s.length();
        int res = n / 2;
        for (int d = 1; d <= n / 2; d++) {
            if (n % d == 0) {
                int changes = 0;
                for (int i = 0; i < d; i++) {
                    int[] count = new int[26];
                    int maxFreq = 0;
                    for (int j = i; j < n; j += d) {
                        maxFreq = Math.max(maxFreq, ++count[s.charAt(j) - 'a']);
                    }
                    changes += (n / d) - maxFreq;
                }
                res = Math.min(res, changes);
            }
        }
        return res;
    }
}
